import React, { useEffect, useRef } from 'react';
import './App.css';
import * as d3 from 'd3';

function App() {
  const d3Chart = useRef();

  const data = [
    { skill: 'CSS', value: 80 },
    { skill: 'HTML', value: 70 },
    { skill: 'JS', value: 85 },
    { skill: 'ANGULAR', value: 90 },
    { skill: 'REACT', value: 75 },
    { skill: 'D3', value: 70 },
    { skill: 'NODE JS', value: 65 },
    { skill: 'JAVA', value: 65 },
    { skill: 'UI DESIGN', value: 70 },
    { skill: 'XD', value: 65 },
  ];
  useEffect(() => {
    d3Chart.append('g').data(data).exit();
  });

  return (
    <div className='App'>
      <svg ref={d3Chart} />
      <h1>Hello</h1>
    </div>
  );
}

export default App;
